import React from 'react';

const Service = () => {
  const services = [
    {
      title: 'Targeted Recruitment',
      description: 'We find top-tier talent with the right skills and work ethic for your startup.',
      icon: 'fa-user-tie'
    },
    {
      title: 'Specialized Training',
      description: 'Customized training programs for new hires to ensure success from day one.',
      icon: 'fa-chalkboard-teacher'
    },
    {
      title: 'Inside Sales Representatives',
      description: 'Skilled inside sales reps to generate leads, qualify prospects, and close deals.',
      icon: 'fa-phone-volume'
    },
    {
      title: 'Sales Development Representatives (SDRs)',
      description: 'Driven SDRs to effectively prospect and qualify leads to fuel your sales pipeline.',
      icon: 'fa-clipboard-list'
    },
    {
      title: 'Account Managers',
      description: 'Experienced account managers to build strong relationships and drive customer retention.',
      icon: 'fa-users'
    },
    {
      title: 'Technical Support Specialists (Tier 1, Tier 2)',
      description: 'Skilled technical support specialists to provide timely solutions to customer issues.',
      icon: 'fa-cogs'
    },
    {
      title: 'Customer Support Representatives',
      description: 'Empathetic customer support representatives ensuring positive customer experience.',
      icon: 'fa-headset'
    },
    {
      title: 'Remote-Ready Professionals',
      description: 'Candidates with proven remote work experience and necessary tools to work effectively.',
      icon: 'fa-laptop'
    },
    {
      title: 'Ongoing Support',
      description: 'We ensure smooth onboarding and long-term success for both clients and candidates.',
      icon: 'fa-people-carry'
    },
  ];

  return (
    <div className="container-xxl py-6">
      <div className="container">
        <div className="mx-auto text-center wow animate__slideInUp" data-wow-delay="0.1s" style={{ maxWidth: '600px' }}>
          <div className="d-inline-block border rounded-pill text-primary px-4 mb-3">Our Services</div>
          <h2 className="mb-5">We Provide Solutions for Your Business</h2>
        </div>
        <div className="row g-4">
          {services.map((service, index) => (
            <div key={index} className="col-lg-4 col-md-6 wow animate__slideInUp" data-wow-delay={`${0.1 * (index + 1)}s`}>
              <div className="service-item rounded h-100">
                <div className="d-flex justify-content-between">
                  <div className="service-icon">
                    <i className={`fa ${service.icon} fa-2x`} style={{ color: '#007bff' }}></i>
                  </div>
                  <a className="service-btn" href="">
                    <i className="fa fa-link fa-2x"></i>
                  </a>
                </div>
                <div className="p-5">
                  <h5 className="mb-3">{service.title}</h5>
                  <span>{service.description}</span>
                  <a className="btn btn-primary rounded-pill py-3 px-5 mt-2" href="">Read More</a>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Service;
